import React from 'react';
import './App.css';
import HorizontalNav from './components/HorizontalNav/HorizontalNav';
import VerticalNav from './components/VerticalNav/VerticalNav';

const App = () => {
  return (
    <div className="App">
      <header> 
        <HorizontalNav />
      </header>
      <VerticalNav />
    </div>
  );
};

export default App;
